import React from 'react';
import { CodewarsLink, Leaderboard } from './MyComponents';


// createElement function
function createElement(content, tag = 'div', properties = {}) {
  return React.createElement(tag, properties, content);
}

// createUnorderedList function
function createUnorderedList(list) {
  return React.createElement(
    'ul',
    null,
    list.map((item, index) =>
      React.createElement('li', {  index }, item)
    )
  );
}

// Example usages of the functions
const customTag = createElement('Hello World');
const fruits = createUnorderedList(['apples', 'oranges', 'bananas']);

const names = <div>
  <a href="http://www.codewars.com/users/GiacomoSorbi">GiacomoSorbi</a>
  <a href="http://www.codewars.com/users/ZozoFouchtra">ZozoFouchtra</a>
</div>

// Render the elements to the DOM
export default function App () {
  const leaders = ['Sch3lp', 'nplus' ,'OverZealous']
  return (
  <div>
    <Leaderboard leaders={leaders} />
    <CodewarsLink names={names} />
    {customTag}
    {fruits}
  </div>
);
}

// Export the App component
